// Function to find prime factors of a given number
function primeFactors(n) {
  const factors = [];
  const bound = Math.sqrt(n); // Calculate square root for optimization

  // Divide by 2 until it's an odd number
  while (n % 2 === 0) {
    factors.push(2);
    n /= 2;
  }

  // Check odd numbers starting from 3
  for (let i = 3; i <= bound; i += 2) {
    while (n % i === 0) {
      factors.push(i);
      n /= i;
    }
  }

  // If the remaining number is a prime greater than 2
  if (n > 2) {
    factors.push(n);
  }

  return factors;
}

// Function to find divisors of a given number and calculate their sum
function divisors(n) {
  const divisors = [];
  let divisorSum = 0;
  const bound = Math.sqrt(n);

  // Iterate through potential divisors up to the square root
  for (let i = 1; i <= bound; i++) {
    if (n % i === 0) {
      divisors.push(i);
      divisorSum += i;

      // Avoid duplicates for perfect squares
      if (i !== n / i) {
        divisors.push(n / i);
        divisorSum += n / i;
      }
    }
  }

  // Sort the divisors in ascending order
  const sortedDivisors = divisors.sort((a, b) => a - b);
  const numberOfDivisors = sortedDivisors.length;

  return {
    div: sortedDivisors,
    n: numberOfDivisors,
    sum: divisorSum
  };
}


function convertToRoman(num) {
  if (num <= 0 || num > 3999) {
    return "Roman number too big.";
  }

  const romanNumerals = [
    { value: 1000, symbol: "M" },
    { value: 900, symbol: "CM" },
    { value: 500, symbol: "D" },
    { value: 400, symbol: "CD" },
    { value: 100, symbol: "C" },
    { value: 90, symbol: "XC" },
    { value: 50, symbol: "L" },
    { value: 40, symbol: "XL" },
    { value: 10, symbol: "X" },
    { value: 9, symbol: "IX" },
    { value: 5, symbol: "V" },
    { value: 4, symbol: "IV" },
    { value: 1, symbol: "I" }
  ];

  let result = "";

  for (const numeral of romanNumerals) {
    while (num >= numeral.value) {
      result += numeral.symbol;
      num -= numeral.value;
    }
  }

  return result;
}




// Function to format prime factors in a human-readable way
function formatFactors(primeFactors) {
  const uniqueFactors = Array.from(new Set(primeFactors));
  const formattedFactors = uniqueFactors.map(factor => {
    // Count the occurrences of each prime factor (exponent)
    const exponent = primeFactors.filter(f => f === factor).length;
    // Format the factor with exponent if it appears more than once
    return exponent > 1 ? factor + '^' + exponent : factor.toString();
  });

  return formattedFactors.join(' × '); // Join formatted factors with ' × '
}


function formatNumber(num) {
  const formattedNumber = num.toFixed(6);
  return formattedNumber.endsWith('.000') ? parseInt(formattedNumber) : parseFloat(formattedNumber);
}




// Main code
const number = 2651;

// Get prime factors and divisors
const resultFactors = primeFactors(number);
const resultDivisors = divisors(number);

// Format prime factors
const formattedFactors = formatFactors(resultFactors);

// Build output string
let output = "";

output += "Number: " + number + "\n\n";

output += "Square root: " + formatNumber(Math.sqrt(number)) + "\nSquare: " + formatNumber(Math.pow(number, 2)) + "\nCube: " + formatNumber(Math.pow(number, 3)) + "\n\n";

output += "Dec: " + number.toString(2) + "\nOct: " + number.toString(8) + "\nHex: " + number.toString(16) + "\n";

output += "Roman: " + convertToRoman(number) + "\n\n";

output += "Prime factorization:\n" + formattedFactors + "\n\n";

output += "Divisors (n = " + resultDivisors.n + "; sum = " + resultDivisors.sum + "):\n" + resultDivisors.div.join(', ');

// Display output
console.log(output);

